import React, { useState } from "react";
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './pages/Home';
import HomeAuth from './pages/HomeAuth';
import Addpage from './pages/Addpage';
import LoginPage from './pages/LoginPage';
import HomeNavbar from './components/HomeNavbar';
import HomeAuthNavbar from './components/HomeAuthNavbar';
import AddpageNavbar from './components/AddpageNavbar';
import LoginPageNavbar from './components/LoginPageNavbar';
import './App.css';

function App() {
  // Initialize recipes state with preset recipes
  const [recipes, setRecipes] = useState([
    {
      id: 1,
      img: "data:image/jpeg;base64,",
      recipe: "Paul's Famous Spaghetti",
      ingredient: "Ground Beef, Tomato Sauce, Pasta",
      instruction: "Step 1. Cook the spaghetti in salted water Step 2. Toss the cooked spaghetti with a flavorful sauce",
    },
    {
      id: 2,
      img: "data:image/jpeg;base64,",
      recipe: "Ratatouille",
      ingredient: "Eggplant, Zucchini, Carrot, Tomatoes, Olive Oil, Herbs, Bread",
      instruction: "Step 1. Add Vegatbles and bake Step 2. Slice Vegatables ...",
    },
    {
      id: 3,
      img: "data:image/jpeg;base64,",
      recipe: "Joseph's Cookies",
      ingredient: "Cookie Batter",
      instruction: "Step 1. Roll sough into balls Step 2. Place on baking pan Step 3. Bake",
    },
  ]);

  const [users, setUsers] = useState([]);

  const handleAddRecipe = (newRecipe) => {
    setRecipes([...recipes, newRecipe]);
  };

  const handleLogin = (newUser) => {
    setUsers([...users, newUser]);
  };

  return (
    <Router>
      <div>
        <Routes>
          <Route
            path="/"
            element={
              <>
                <HomeNavbar />
                <Home recipes={recipes} onAddRecipe={handleAddRecipe} />
              </>
            }
          />
          <Route
            path="/HomeAuth"
            element={
              <>
                <HomeAuthNavbar />
                <HomeAuth recipes={recipes} onAddRecipe={handleAddRecipe} />
              </>
            }
          />
          <Route
            path="/Addpage"
            element={
              <>
                <AddpageNavbar />
                <Addpage onAddRecipe={handleAddRecipe} />
              </>
            }
          />
          <Route
            path="/Loginpage"
            element={
              <>
                <LoginPageNavbar />
                <LoginPage onLogin={handleLogin} />
              </>
            }
          />
        </Routes>
      </div>
    </Router>
  );
}


export default App;








